import { useState, useEffect } from "react";
import DynamicPricing from "./DynamicPricing";
import {
  TextField,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
} from "@mui/material";
const Home = () => {
  const [manfacturedate, setManfacturedate] = useState(new Date());
  const [deleveryDate, setDeleveryDate] = useState(new Date());
  const [cost, setCost] = useState(new Date());
  return (
    <div class="grid grid-cols-1 divide-x indent-[5%]  divide-blue-200 mx-w-[1240px] mx-auto grid gap-1 ease-in-out px-4">
      <div className="bg border-r-green-100 border-color: rgb(214 211 209)">
        <h1 className="bg bg-red-300">computer Selection creteria</h1>
        <h2 className="">
          Dynamic price optimization is the process of offering products at
          various prices that adjust according to market conditions. Pricing on
          products and services are dynamically changed based on competitive
          pricing, supply & demand, sales requirements, and conversion rates.
        </h2>
        <h3>
          so we are working the two Ethiopian company called Ubuy And Jiji
        </h3>
        <div class="grid grid-cols-2 divide-x indent-[5%]  divide-blue-200 mx-w-[1240px] mx-auto grid gap-1 ease-in-out px-4">
          <div>
            <button
              onClick={() => {
                <DynamicPricing />;
              }}
              className="text-purple-600 rounded-md font-semibold "
            >
              delete
            </button>
          </div>
          <div>
            <button
              // onClick={() => {
              //   deleteOtherBankCreditExposure(otherBankData.Id);
              // }}
              className="text-purple-600 rounded-md font-semibold "
            >
              update
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Home;
